import React from 'react';
import s from "./Dialogs.module.css";

const Dialogs = (props) => {
    return (
        <div className={s.dialogs}>
            <div className={s.dialogs-items}>
                <div className={s.item}></div>
                <div className={s.item}></div>
                <div className={s.item}></div>
                <div className={s.item}></div>
            </div>
            <div></div>
        </div>
    );
}

export default Dialogs;
